import React, { useState } from "react";

const API_BASE = "http://localhost:3001/api";

function Requester() {
  const [form, setForm] = useState({
    title: "",
    description: "",
    category: "",
    priority: "",
    location: "",
    contact: ""
  });
  const [ticketId, setTicketId] = useState(null);
  const [tickets, setTickets] = useState([]);

  const handleChange = (e) =>
    setForm({ ...form, [e.target.name]: e.target.value });

  const submitTicket = async (e) => {
    e.preventDefault();
    const res = await fetch(`${API_BASE}/tickets`, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(form),
    });
    const data = await res.json();
    setTicketId(data.ticketId);
  };

  const trackByPhone = async () => {
    const res = await fetch(`${API_BASE}/tickets?contact=${form.contact}`);
    const data = await res.json();
    setTickets(data.tickets || []);
  };

  return (
    <div style={{ padding: 16, maxWidth: 600, margin: "auto", direction:"rtl" }}>
      <h2 style={{ color: "#003366" }}>إرسال بلاغ جديد</h2>
      <form onSubmit={submitTicket} style={{ display:"flex", flexDirection:"column", gap:8 }}>
        <input name="title" placeholder="عنوان البلاغ" onChange={handleChange} required />
        <textarea name="description" placeholder="الوصف" onChange={handleChange} required />
        <select name="category" onChange={handleChange} required>
          <option value="">اختر الفئة</option>
          <option>Electrical</option>
          <option>Mechanical</option>
          <option>Cleaning</option>
        </select>
        <select name="priority" onChange={handleChange} required>
          <option value="">الأولوية</option>
          <option>High</option>
          <option>Medium</option>
          <option>Low</option>
        </select>
        <select name="location" onChange={handleChange} required>
          <option value="">اختر الاستوديو</option>
          {[...Array(14)].map((_,i)=>
            <option key={i}>Studio {i+1}</option>
          )}
        </select>
        <input name="contact" placeholder="رقم الجوال" onChange={handleChange} required />
        <button type="submit" style={{ background:"#006633", color:"#fff", padding:10 }}>
          إرسال
        </button>
      </form>

      {ticketId && (
        <p style={{marginTop:16, color:"green"}}>
          ✅ تم إنشاء التذكرة، رقمها: {ticketId}
        </p>
      )}

      <hr />
      <h3>متابعة بلاغاتي</h3>
      <button onClick={trackByPhone}>عرض البلاغات</button>
      <ul>
        {tickets.map(t => (
          <li key={t.id}>{t.id} - {t.status}</li>
        ))}
      </ul>
    </div>
  );
}

export default Requester;
